import React, { Component } from "react";
import { Typography } from "@material-ui/core";
import "./Projects.css";

class Projects extends Component {
  render() {
    return (
      <div>
        <section id="__projects">
          <Typography variant="h1" component="h2" gutterBottom>
            Projects
          </Typography>
        </section>
      </div>
    );
  }
}

export default Projects;
